.pro-input-main
  .pro-input-container(
    :class='options.containerClass'
  )
    .input-holder(
      :class='error && entered ? "error" : ""'
    )
      .placeholder(
        :class='isActive ? "active" : ""'
      ) {{placeholderCopy}}
      input(
        v-if='options.type === "number"'
        type='number'
        v-model='input'
        @keydown='handleKey'
        @focus='focused = true'
        @blur='focused = false;entered = true'
      )
      input(
        v-if='options.type === "password"'
        type='password'
        v-model='input'
        @keydown='handleKey'
        @focus='focused = true'
        @blur='focused = false;entered = true'
      )
      input(
        v-else
        v-model='input'
        @keydown='handleKey'
        @focus='focused = true'
        @blur='focused = false;entered = true'
      )
